import React, { useState } from "react";
import "./style.css";

const App = () => {
	const input = document.getElementById("txt_username");
	const [fetchvalue, getInput] = useState("task1");
	return (
		<div className="todo_div">
			<h1> ToDo List</h1>
			<input
				type="text"
				name="username"
				id="txt_username"
				placeholder="Enter Your Todo"
				className="txt_username"
			/>
			<br />
			<input
				type="submit"
				name="add todo"
				value="add"
				className="button"
				onClick={() => getInput(
					input.value
				)}
			/>
		</div>
	);
};

export default App;
